import Link from 'next/link'
import { Container,Col,Row } from "react-bootstrap";
// import Header from "../components/header";





class App extends Component {
  constructor(props) {
    super(props);
  }


  render() {

    return (
      <>
        {/* <Header /> */}
        <p>aaa</p>
      </>
    )
  }

}

export default App;
